  return (
    <section class="py-20 bg-gray-800">
  <div class="container px-4 mx-auto">
    <div class="max-w-xl mx-auto mb-20 text-center">
      <h2 class="mt-8 text-5xl lg:text-6xl font-bold font-heading text-white">Connect With Me On</h2>
    </div>

